templates['tmp_section_content_group'] = template({"compiler":[6,">= 2.0.0-beta.1"],"main":function(depth0,helpers,partials,data) {
  return "<div id=\"content-content\">\r\n    <div class=\"site-content\">\r\n        <div id=\"warranty-first-image\" class=\"half extended first\">\r\n            <img src=\"img/sections/warranty/fachadas.jpg\" alt=\"\">\r\n        </div>\r\n        <div class=\"half compressed first\">\r\n            <div class=\"padding-left2\">\r\n                <h3 style=\"font-size: 19px;\">Tecnología Automotriz Vallarta S.A. de C.V.</h3>\r\n                <hr style=\"margin-bottom: 20px;\"/>\r\n                <p align=\"justify\">Suzuki Vallarta fue la primera agencia de la marca SUZUKI en el Estado de Jalisco abriendo sus puertas a los jaliscienses en el año 2005; durante el año 2006 crecimos nuestras instalaciones en el área de servicio y sala de ventas para brindar una mejor atención a nuestros clientes.</p>\r\n                <p align=\"justify\"> Gracias al éxito de la marca, en el año 2008 inauguramos la sucursal de López Mateos que es una de las concesionarias más grandes del país, contamos también con dos agencias mas, ubicadas en Colima y Morelia, convirtiéndonos así, en el grupo con mas agencias Suzuki en el país.</p>\r\n                <p align=\"justify\"> Por 5 años consecutivos nos hemos mantenido dentro de los primeros cinco lugares de ventas a nivel nacional y representamos el 11% de las ventas de la marca Suzuki en México.</p>\r\n                <p align=\"justify\"> Al ser uno de los grupos con más agencias, Suzuki Motor de México nos ha tomado en cuenta para programas piloto de la marca, los más destacados: CRM,            Certificación de Refacciones.</p>\r\n            </div>\r\n\r\n        </div>\r\n        <div class=\"clearfix\"></div>\r\n    </div>\r\n</div>\r\n";
  },"useData":true});
