templates['tmp_section_content_legal_terms'] = template({"compiler":[6,">= 2.0.0-beta.1"],"main":function(depth0,helpers,partials,data) {
  return "<div id=\"content-content\">\r\n    <div class=\"plain\">\r\n        <h1 class=\"center\">Términos legales</h1>\r\n        <h2>Condiciones de la promoción ´Suzuki está contigo´ en las plazas de Cancún y Tijuana</h2>\r\n        <p>\r\n            Este beneficio está restringido a las personas que:\r\n        </p>\r\n        <ol>\r\n            <li style=\"list-style: inherit\">\r\n                Acrediten la legal residencia en dicha zona, es decir que te lo acrediten con un comprobante de domicilio o su credencial para votar, donde consten los domicilios en zona fronteriza;\r\n            </li>\r\n            <li style=\"list-style: inherit\">\r\n                Hagan los trámites de emplacamiento del vehículo en dicha zona fronteriza.\r\n            </li>\r\n            <li style=\"list-style: inherit\">\r\n                Y para las personas Morales, que acrediten a través de su alta de hacienda que tienen su domicilio registrado en dicha zona fronteriza.\r\n            </li>\r\n        </ol>\r\n        <p>\r\n            En cumplimiento a la Legislación vigente, la factura del producto debe de reflejar el costo del I.V.A., del 16%, por lo que el costo del aumento al Impuesto al Valor Agregado, que absorbe SUZUKI MOTOR DE MEXICO, S.A. DE C.V., (Esto siempre y cuando, sea esa persona quien absorba el costo de no ser así y sea el Concesionario, poner el nombre de este), es en el valor del producto.\r\n        </p>\r\n    </div>\r\n</div>\r\n";
  },"useData":true});
