templates['tmp_section_content_privacy_notice'] = template({"compiler":[6,">= 2.0.0-beta.1"],"main":function(depth0,helpers,partials,data) {
  return "<div id=\"content-content\">\r\n    <div class=\"plain\">\r\n        <h1>AVISO DE PRIVACIDAD.</h1>\r\n        <p>En Tecnología Automotriz Vallarta, S.A. de  C.V., con domicilio en Av. Vallarta número<br>\r\n        5300-A,   Colonia   Jardines   Vallarta,   en   Zapopan,   Jalisco,   C.P.   45027,   estamos      comprometidos con la protección y custodia de los datos personales de nuestros clientes, responsabilizándonos  de  su  uso,  manejo  y  confidencialidad;  haciendo  un     esfuerzo constante para resguardarlos y manejarlos conforme a la legislación aplicable.</p>\r\n        <h2>¿Qué datos personales obtenemos y de donde?</h2>\r\n        <p>Para las finalidades señaladas en el presente aviso de privacidad, podemos recabar sus datos personales de distintas formas: cuando usted no los proporciona directamente; cuando visita nuestro sitio de internet, o utiliza nuestros servicios en línea.</p>\r\n        <p>Para prestarle los servicios que solicita requerimos datos personales como pueden ser de identificación (nombre, firma, fecha de nacimiento, correo electrónico, domicilio particular, domicilio laboral, teléfono), laborales, patrimoniales y financieros, los cuales se obtienen de los documentos privados u oficiales que nos proporciona directamente.</p>\r\n        <h2>Sus datos personales serán utilizados para las siguientes finalidades:</h2>\r\n        <p>\r\n            <ul>\r\n                <li>Proveer los servicios y/o productos requeridos por Usted.</li>\r\n                <li>Informar  sobre  cambios,    nuevos  productos,  o  servicios  que  estén  relacionados  con  el contratado o adquirido por el cliente.</li>\r\n                <li>Dar cumplimiento a obligaciones contraídas con nuestros clientes.</li>\r\n                <li>Evaluar la calidad y servicio prestado.</li>\r\n                <li>Realizar estudios de mercado.</li>\r\n                <li>Actividades de mercadeó y promoción.</li>\r\n                <li>Dar cumplimiento a requerimientos legales.</li>\r\n                <li>Prestar  el  servicio  de  intermediación   para  la  contratación   de  pólizas  de  seguros,  y otorgamiento de créditos con instituciones financieras.</li>\r\n                <li>Y  otras  como:  mantener  actualizados   nuestros  registros  para  poder  responder  a  sus consultas, invitarle a eventos exclusivos, hacer válida la garantía de su vehículo, informarle acerca de llamados a revisión de su vehículo, en general, dar seguimiento a nuestra relación comercial.</li>\r\n            </ul>\r\n        </p>\r\n        <h2>Derechos ARCO.</h2>\r\n        <p>Usted tiene derecho de acceder a sus datos personales que poseemos y  a los detalles del tratamiento de los mismos, así como a rectificarlos en caso de ser inexactos o incompletos; cancelarlos, o bien revocar su autorización cuando considere que no se requieren para algunas de las  finalidades señaladas en el presente aviso de privacidad, estén siendo utilizados para finalidades no consentidas o haya finalizado la relación contractual o de servicio, o bien, oponerse al tratamiento de los mismos para algún fin en especifico.<br>\r\n        Los mecanismos que hemos implementado para el ejercicio de dichos derechos son a través de la presentación de la solicitud respectiva enviada al correo electrónico avisoprivacidad@suzukivallarta.com.mx, o en el departamento de privacidad de Tecnología Automotriz Vallarta, ubicado  en  Av. Vallarta número 5300-A, Colonia Jardines Vallarta, en Zapopan, Jalisco, C.P. 45027.</p>\r\n        <p>Es importante informarle que su solicitud deberá contener, al menos, la siguiente información: (i) su nombre o el de su representante, domicilio u otro medio para comunicarle la respuesta; (ii) los documentos que acrediten su identidad, o en su caso, el de su representante; (iii) la descripción clara y precisa de los datos personales respecto de los cuales busca ejercer su derecho y (iv) cualquier otro elemento o documento que facilite la localización de los datos personales. Asimismo, deberá acreditar su identidad mediante identificación  oficial  vigente  o  en  caso  de  presentar  su  solicitud  a  través  de  su representante, a través de instrumento público, carta poder firmada ante dos testigos o declaración en comparecencia personal del titular.</p>\r\n        <p>Nos comprometemos a darle respuesta en un plazo máximo de 20 días hábiles contados a partir del día en que recibimos su solicitud. Si requiere acceso a sus datos personales, la reproducción de éstos se llevará a cabo a través de copias simples o archivo electrónico. En caso de solicitar su derecho de rectificación, su solicitud deberá ir acompañada de la documentación que ampare la procedencia de lo solicitado.</p>\r\n        <h2>Trasferencia de datos personales.</h2>\r\n        <p>Sus datos personales pueden ser transferidos y tratados dentro y fuera del país, por personas distintas a esta empresa. En este sentido su información puede ser compartida con Suzuki Motor de México, S.A. de C.V. su matriz, afiliadas y subsidiarias, nacionales o extranjeras, personas físicas y morales incluyendo instituciones financieras, aseguradoras, talleres, servicios de grúas o asistencia técnica o mecánica, otras agencias Suzuki en México, según sea necesario para la adecuada prestación de los servicios de la Agencia, para los fines previstos en el presente Aviso de Privacidad.</p>\r\n        <p>Nos comprometemos a no trasferir su información personal a mas terceros sin su consentimiento, salvo las excepciones previstas en el artículo 37 de la Ley Federal  de Protección de Datos Personales en Posesión de los Particulares, así como a realizar esta trasferencia en los términos que fija la propia Ley.</p>\r\n        <p>Usted puede manifestar su oposición para que sus datos personales sean transferidos en los términos antes señalados, enviándonos un correo electrónico a la dirección <a href=\"mailto:avisoprivacidad@suzukivallarta.com.mx\">avisoprivacidad@suzukivallarta.com.mx</a>, en el que expresamente manifieste lo siguiente: “No consiento que mis datos personales sean transferidos en los términos que señala el Aviso de Privacidad”</p>\r\n        <p>Tecnología  Automotriz  Vallarta,  S.A.  de  C.V.,  se  reserva  el  derecho  de  efectuar  en cualquier momento modificaciones o actualizaciones al presente aviso de privacidad, para<br>\r\n        la atención de novedades legislativas, políticas internas o nuevas, requerimientos para la prestación u ofrecimiento de nuestros servicios o productos.</p>\r\n        <p>Estas modificaciones estarán disponibles al público a través de los siguientes medios: a) anuncios  visibles  en  nuestros  establecimientos,  b)  trípticos  o  folletos  disponibles  en nuestras agencias, c) en nuestra página de internet, en la sección de Aviso de Privacidad.</p>\r\n        <p>Para mayor información sobre el presente Aviso de Privacidad, favor de comunicarse al departamento de privacidad ubicado en Av. Vallarta número 5300-A, Colonia Jardines Vallarta en Zapopan, Jalisco, teléfono (33) 37771989, o bien, solicitarla a través de la dirección  <a href=\"mailto:avisoprivacidad@suzukivallarta.com.mx\">avisoprivacidad@suzukivallarta.com.mx</a>.</p>\r\n        <p>Si usted considera que sus derechos de protección de datos personales ha sido lesionado por alguna  conducta    de  esta  empresa,  de  sus  empleados,  o  de    nuestras  actuaciones  o respuestas;  presume que en el tratamiento de sus datos personales existe alguna violación a las disposiciones previstas en la Ley Federal de Protección de Datos Personales en Posesión de los Particulares, podrá interponer la queja o denuncia correspondiente ante el IFAI (Instituto Federal de Acceso a la Información y Protección de Datos) para mayor información visite la pagina de internet www.ifai.org.mx.</p>\r\n    </div>\r\n</div>\r\n";
  },"useData":true});
